import axios from 'axios'
import {useEffect, useState} from 'react'
import './Databases.css'

const Databases = () => {

const DbEntry = ({ data }) => {
	return (
		<div className='Entry'>
			<p className='Title'>{data.title}</p>
			{data._id}
		</div>
	)
}

const [blastDb, setBlastDb] = useState(null)
const [skaniSketch, setSkani] = useState(null)

const getMany = (Db, hook) => {
	axios.get(`http://192.168.1.37:8080/db/${Db}}`).then(res => console.log(res.data.map(entry => { return <DbEntry key={ entry._id } data={ entry }/> })))
}

const getDbs = () => {
	getMany(`blast-db`, setBlastDb)
	getMany(`skani-sketch`, setSkani)
}

useEffect(getDbs,[])

	return (
		<div className='DatabaseList'>
			<div className='BlastDb'>{blastDb}</div>
			<div className='SkaniSketch'>{skaniSketch}</div>
		</div>
	)
}

export default Databases
